import React, { Component } from 'react';
import Notification from './Notification';

class NotificationBox extends Component {
    render() {
        return (

            <div class="jumbotron m-3 shadow p-3">
                <div className="row">
                <Notification title="Missing Assignment" location="English 3" details="Reading Assignment 3.  This assignment is worth 25 points of which you have currently earned 0" />
                <Notification title="Missing Assignment" location="English 3" details="Reading Assignment 3.  This assignment is worth 25 points of which you have currently earned 0" />
                <Notification title="Missing Assignment" location="English 3" details="Reading Assignment 3.  This assignment is worth 25 points of which you have currently earned 0" />
                </div>
            </div>


        );
    }
}

export default NotificationBox;
